#>>> gcContent("ACCGC")0.8>>> gcContent("ATACTAAA")0.125
def gcContent(DNA):
    countgc = 0.0
    for letter in DNA:
        if letter == 'G' or letter == 'C':
            countgc = countgc + 1
    ratio = countgc/len(DNA)
    return ratio
    
        
        
            
          

        
    
             
